import React from "react";
import styled from "styled-components";
import WeirdImageGrid from "./WeirdImageGrid";

const Wrapper = styled.div`

    `;
function getElements(e){
    if(e.thin_column){

    }else if(e.weird_image_grid){
        return (
            <WeirdImageGrid>
                {e.weird_image_grid.map((e, index) => {
                <p>{e}</p>
                })
                }
            </WeirdImageGrid>
        )
    }
}

const SectionReverse=(props)=>(
    <Wrapper>
        {props.content.map((c, index)=>{
            return c.getElements
        })}

    </Wrapper>
)

export default SectionReverse;
